import React, { useState } from 'react';
import { FaEnvelope, FaMapMarkerAlt, FaPhone, FaGenderless, FaCalendarAlt, FaUser, FaMoneyBillAlt } from 'react-icons/fa';
import './EditProfile.css';

const EditProfile = () => {
  const [fullname, setFullname] = useState('');
  const [email, setEmail] = useState('');
  const [address, setAddress] = useState('');
  const [phone, setPhone] = useState('');
  const [gender, setGender] = useState('');
  const [showConfirmation, setShowConfirmation] = useState(false);
  const [showSuccess, setShowSuccess] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Lưu thông tin vào cơ sở dữ liệu hoặc gọi API tại đây
    // Sau khi lưu thành công, hiển thị thông báo thành công
    setShowConfirmation(false);
    setShowSuccess(true);
  };

  const handleConfirmationSave = () => {
    setShowConfirmation(false);
    setShowSuccess(true);
  };

  const handleConfirmationClose = () => {
    setShowConfirmation(false);
  };

  const handleEditProfile = () => {
    // Điền thông tin từ cơ sở dữ liệu hoặc API vào đây
    const user = {
      fullname: 'John Doe',
      email: 'johndoe@example.com',
      address: '123 Street, City',
      phone: '1234567890',
      gender: 'Male',
      createdAt: '2022-01-01',
      updatedAt: '2022-02-01',
      role: 'customer',
      balance: 1000,
    };
    setFullname(user.fullname);
    setEmail(user.email);
    setAddress(user.address);
    setPhone(user.phone);
    setGender(user.gender);
  };

  return (
    <div className="edit-profile">
      <h2 className="edit-profile__title">Chỉnh sửa thông tin</h2>
      <form onSubmit={handleSubmit} className="edit-profile__form">
        <div className="edit-profile__form-group">
          <label className="edit-profile__label">Họ và tên:</label>
          <input type="text" value={fullname} onChange={(e) => setFullname(e.target.value)} className="edit-profile__input" />
        </div>
        <div className="edit-profile__form-group">
          <label className="edit-profile__label">Email:</label>
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} className="edit-profile__input" />
        </div>
        <div className="edit-profile__form-group">
          <label className="edit-profile__label">Địa chỉ:</label>
          <input type="text" value={address} onChange={(e) => setAddress(e.target.value)} className="edit-profile__input" />
        </div>
        <div className="edit-profile__form-group">
          <label className="edit-profile__label">Điện thoại:</label>
          <input type="text" value={phone} onChange={(e) => setPhone(e.target.value)} className="edit-profile__input" />
        </div>
        <div className="edit-profile__form-group">
          <label className="edit-profile__label">Giới tính:</label>
          <input type="text" value={gender} onChange={(e) => setGender(e.target.value)} className="edit-profile__input" />
        </div>
        <div className="edit-profile__actions">
          <button type="button" onClick={handleEditProfile} className="edit-profile__button">Chỉnh sửa</button>
          <button type="submit" className="edit-profile__button" onClick={() => setShowConfirmation(true)}>Lưu thông tin</button>
        </div>
      </form>
      {showConfirmation && (
        <div className="edit-profile__confirmation">
          <h3 className="edit-profile__confirmation-title">Xác nhận lưu thông tin</h3>
          <p className="edit-profile__confirmation-message">Bạn có chắc chắn muốn lưu thông tin đã chỉnh sửa?</p>
          <div className="edit-profile__confirmation-buttons">
            <button type="button" className="edit-profile__confirmation-button edit-profile__confirmation-button--save" onClick={handleConfirmationSave}>Xác nhận</button>
            <button type="button" className="edit-profile__confirmation-button edit-profile__confirmation-button--cancel" onClick={handleConfirmationClose}>Hủy</button>
          </div>
        </div>
      )}
      {showSuccess && (
        <div className="edit-profile__success">
          <p className="edit-profile__success-message">Thông tin đã được lưu thành công.</p>
        </div>
      )}
    </div>
  );
};

export default EditProfile;
